//import logo from './logo.svg';
import Toolbar from './components/Toolbar/Toolbar'

class App extends Component {
  render() {
    return (
      <div className="App">
        <Toolbar />
        <main style={{marginTop:'200px'}}>
          <p>i am a contetn</p>
        </main>
      </div>
    );

  }
  
}

export default App;
